def get_adjacent_cells(x, y, N):
    """This function takes the current cell position and size of the grid
    and returns all the valid adjacent cells."""
    adjacent_cells = []
    for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
