def minPath(grid: List[List[int]], k: int) -> List[int]:
    """This function takes the grid and k and returns the minimum path of length
    k."""

    N = len(grid)    # Size of the grid

    # Initialize the queue.
    queue = PriorityQueue()
    for i in range(N):
        for j in range(N):
            queue.put(([(grid[i][j])],(i,j), 1))

    # Loop until queue is empty
    while not queue.empty():
        path, (x, y), steps = queue.get()
        if steps == k:
            return path
        for new_x, new_y in get_adjacent_cells(x, y, N):
            queue.put((path + [grid[new_x][new_y]], (new_x, new_y), steps + 1))

    return []  # If no path of length k is found

