    if planet1 not in planets or planet2 not in planets:
        return ()

    # We get the index of planet1 and planet2 in our planets list
    index1 = planets.index(planet1)
    index2 = planets.index(planet2)

    # If index1 > index2 we swap planet1 and planet2 so that planet1 is always closer to the Sun
    if index1 > index2:
        index1, index2 = index2, index1

